import React from 'react';

// Components
import Menu from './Menu/Menu';

// CSS
import classes from './Footer.module.css';

// Component
const Footer = () => (
    <div className={classes.Footer}>
        <Menu>
            lala
        </Menu>
    </div>
);

// Export
export default Footer;
